sourcesContent:
import styled from 'styled-components'

export const Button = styled.button`
background: none;
font-size: 16px;
margin: 5px;
color: white;
padding: 4px 8px;
border: 2px solid white;
border-radius: 3px;
display: block;
text-decoration: none;
font: inherit;
`
